import '../css/navbar.css'
import '../css/profile.css'
import React from 'react';
import Main from "../Main/main";
import ForMapPage from "../Map/forMapPage";
import LineGraph from '../Map/LineGraph';
import Test from '../Test/Test.js';
import What from '../WhatIsCorona/What';
import Video from '../Video/Video';
import Login from '../LoginAndRegister/Login';
import Register from '../LoginAndRegister/Register';
import H2 from '../Default/H2';
import MyProfile from '../Profile/MyProfile';
import {BrowserRouter as Router,Switch,Route,Link} from 'react-router-dom';
import Axios from "axios";

   function App() {

       Axios.defaults.withCredentials = true;

       return (
    <div className="App">

        <div className="topnav">
            <a className="logoA" href="#"><img id="metbix" src="/images/logo.png"/></a>
            <a className="deA" href="http://localhost:3000/">Home</a>
            <a className="deA" href="/what">What is CoronaVirus?</a>
            <a className="deA" href="/map">Map</a>
            <a className="deA" href="/test">Test</a>
            <a className="deA" href="/video">Videos</a>
            <a className="deA account" >Account</a>


        </div>
        <img id="receb" src='/images/rcb.jpg'/>


        <div className="my_profile">

            <img className="my_image" src='/images/rcb.jpg'/>

            <div className="my_info">

                <h4>Aliyev Israil</h4>
                <p>space.y@inbox.ru</p>

            </div>

            <div className="my_logout">
                <p>LOGOUT</p>
            </div>

            <i className="fas fa-times-circle my_close"></i>


        </div>


        <Router>

            <Switch>

                <Route path='/' exact component={Main}/>
                <Route path='/map' exact component={ForMapPage}/>
                <Route path='/test' exact component={Test}/>
                <Route path='/what' exact component={What}/>
                <Route path='/video' exact component={Video}/>
                <Route path='/login' exact component={Login}/>
                <Route path='/register' exact component={Register}/>
                <Route path='/h2' exact component={H2}/>
                <Route path='/profile' exact component={MyProfile}/>





            </Switch>

        </Router>

    </div>
  );
}

export default App;
